// contracts/GameItem.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract UNCRAgent is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    string private _customBaseURI;
    uint256 private _price;
    uint256 private _maxCreationable;

    mapping (address => uint256[]) private _ownedTokens;

    constructor(string memory customBaseURI_) ERC721("UNCRAgent", "UNCRAgent") {
      _customBaseURI = customBaseURI_;
      _price = 0.05 ether;
      _maxCreationable = 1000;
    }

    function tokenOfOwnerByIndex(address owner, uint256 index) public view returns (uint256) {
        require(index < ERC721.balanceOf(owner), "ERC721Enumerable: owner index out of bounds");
        return _ownedTokens[owner][index];
    }

    function setBaseURI(string memory customBaseURI_) public onlyOwner {
      _customBaseURI = customBaseURI_;
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        _requireMinted(tokenId);

        string memory baseURI = _baseURI();
        return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, Strings.toString(tokenId), ".png")) : "";
    }

    function accountCreation(uint256 quantity) 
        public
        payable
        returns (uint256)
    {
        require(quantity <= 5);
        for (uint i=0 ; i<quantity; i++){
          accountCreationSignup(msg.sender);
        }
    }

    function accountCreationSignup(address recipient) private {
      require(_tokenIds.current() <= _maxCreationable, "Project is finished minting");
      uint256 newItemId = _tokenIds.current() + 1;
        _creation(recipient, newItemId);
        _addTokensToOwnerEnumeration(recipient, newItemId);
        _tokenIds.increment();
    }

            // add tokens to the _alltokens array and set the position of the tokens index 
    function _addTokensToOwnerEnumeration(address to, uint256 tokenId) private {
      // EXERCISE - CHALLENGE - D
      // 1. add address and token id to the _ownedTokens
      _ownedTokens[to].push(tokenId);
    }

    function _baseURI() internal view virtual override returns (string memory) {
      return _customBaseURI;
    }
}
